import React from 'react'
import Modal from 'react-modal';
import './createFlow.css'


function CreateFlow() {
    const [description, setDescription] = useState("");
    const [stream, setStream] = useState("");
    const [credit, setCredit] = useState("");
    const [savedTransaction, setDebit] = useState("");

    const [modalIsOpen, setIsOpen] = React.useState(false);

    function openModal() {
        setIsOpen(true);
    }

    function afterOpenModal() {
        // references are now sync'd and can be accessed.
    }

    function closeModal() {
        setIsOpen(false);
    }

    const create_Flow = () => {

    }

  return (
    <div>
      <button id='d' onClick={openModal}>Open Modal</button>
      <Modal
        isOpen={modalIsOpen}
        onAfterOpen={afterOpenModal}
        onRequestClose={closeModal}
        contentLabel="Add new Entry"
        className="Modal"
        overlayClassName="Overlay"
      >
        <form id="loginForm" onSubmit={create_Flow}>
            <div className="inputTextOverlay">
                Description<br/>
                <input className="record_form" autoFocus type="text" id="description" placeholder="e.g. worker salary" onChange={(e)=>{setDescription(e.target.value)}} value={description} /><br/><br/><br/>
            </div>

            <div className="inputTextOverlay">
                Account<br/>
                <input className="record_form" type="text" id="email" placeholder="e.g. worker salary" onChange={(e)=>{setStream(e.target.value)}} value={stream} /><br/><br/><br/>
            </div>

            <div className="inputTextOverlay">
                Amount<br/>
                <input className="record_form" type="credit" id="password" placeholder="0.00" onChange={(e)=>{setCredit(e.target.value)}} value={credit} /><br/><br/>
                <input className="record_form" type="debit" id="password" placeholder="0.00" onChange={(e)=>{setDebit(e.target.value)}} value={debit} /><br/><br/>
            </div>

            <div>
                <label>
                    <select value={savedTransaction} onChange={this.handleChange}>
                        <option value="grapefruit">Grapefruit</option>
                        <option value="lime">Lime</option>
                        <option value="coconut">Coconut</option>
                        <option value="mango">Mango</option>
                    </select>
                </label>
                <button></button>
            </div>

            <div>
                Category<br/>
                <input type="radio" id="html" name="fav_language" value="HTML"/>
                <label for="html">HTML</label><br/>
                <input type="radio" id="css" name="fav_language" value="CSS"/>
                <label for="css">CSS</label><br/>
                <input type="radio" id="javascript" name="fav_language" value="JavaScript"/>
                <label for="javascript">JavaScript</label>
            </div>

            <div id="submitBTN_overlay">
                <button id="submit" type="submit" value="Done" >Done</button>
            </div>
          </form>
      </Modal>
    </div>
  )
}

export default CreateFlow
